import axios from 'axios';
import React, { useState, useEffect, useContext } from 'react';
import { consultarToken } from '../Config/Api'
import { AuthContext } from '../Context/auth';
import TabelaTokens from './TabelaTokens';


const TokenTable = () => {
    const { user } = useContext(AuthContext);
    const [tabela, setTabela] = useState();
    console.log("area do TOKEN TABLE", user?.idEmpresa);

    const buscarTabela = async () => {
        const { data } = await axios.get(consultarToken(user?.idEmpresa));
        setTabela(data);
      };

      useEffect(()=> {
        buscarTabela();
      })
   
   
      const colunas = [
        {heading: 'token'},
        {heading: 'descricao'},
        {heading: 'status'}
      ]

      console.log(tabela);

  return (
    <table className="table table-responsive-md">
        <thead>
            <tr>
                <th><strong>TOKEN</strong></th>
                <th><strong>DESCRIÇÃO</strong></th>
                <th><strong>Status</strong></th>
                <th><strong>OPÇÕES</strong></th>
                <th></th>
            </tr> 
        </thead>
        <tbody>
            <TabelaTokens  data={tabela} column={colunas} />
        </tbody>
    </table>
  )
}

export default TokenTable
